#!/usr/bin/env python3

# Generated by 2.3.0 https://github.com/kyuridenamida/atcoder-tools  (tips: You use the default template now. You can remove this line by using your custom template)
def main():
    H, W = map(int, input().split())
    field = []
    for _ in range(H):
        field.append([1 if i == "+" else -1 for i in list(input())])
    # print(field)
    dp = [[None] * W for _ in range(H)]
    dp[H - 1][W - 1] = 0
    # print(dp)
    for rest in range(1, H + W - 1):
        for hh in range(H):
            ww = rest - hh
            if ww < 0 or ww >= W:
                continue
            if (H + W - 2 - rest) % 2 == 0: # 先手
                if H - hh >= H:
                    dp[H - 1 - hh][W - 1 - ww] = dp[H - 1 - hh][W - ww] + field[H - 1 - hh][W - ww]
                elif W - ww >= W:
                    dp[H - 1 - hh][W - 1 - ww] = dp[H - hh][W - 1 - ww] + field[H - hh][W - 1 - ww]
                else:
                    dp[H - 1 - hh][W - 1 - ww] = max(dp[H - hh][W - 1 - ww] + field[H - hh][W - 1 - ww], dp[H - 1 - hh][W - ww] + field[H - 1 - hh][W - ww])
            else:
                if H - hh >= H:
                    dp[H - 1 - hh][W - 1 - ww] = dp[H - 1 - hh][W - ww] - field[H - 1 - hh][W - ww]
                elif W - ww >= W:
                    dp[H - 1 - hh][W - 1 - ww] = dp[H - hh][W - 1 - ww] - field[H - hh][W - 1 - ww]
                else:
                    dp[H - 1 - hh][W - 1 - ww] = min(dp[H - hh][W - 1 - ww] - field[H - hh][W - 1 - ww], dp[H - 1 - hh][W - ww] - field[H - 1 - hh][W - ww])
            # print(rest, ww, hh)
            # print(H - 1 - hh, W - 1 - ww)
    ans = dp[0][0]
    if ans > 0:
        print("Takahashi")
    elif ans < 0:
        print("Aoki")
    else:
        print("Draw")






if __name__ == '__main__':
    main()
